   "source": [
    "lm = lm(Salary ~ ., data = train)\n",
    "lin_pred = predict(lm, newdata = test)\n",
    "lin_mse = mean((lin_pred - test$Salary)^2)\n",
    "\n",
    "X_tr = model.matrix(Salary ~ ., train)[ , -1]\n",
    "y_tr = train$Salary\n",
    "X_tst = model.matrix(Salary ~ ., test)[ , -1]\n",
    "y_tst = test$Salary\n",
    "rr_model = glmnet(X_tr, y_tr, alpha = 0)\n",
    "cv_model = cv.glmnet(X_tr, y_tr, alpha = 0)\n",
    "rr_pred = predict(rr_model, newx = X_tst, s = cv_model$lamdba.min)\n",
    "rr_mse = mean((rr_pred - y_tst)^2)\n",
    "\n",
    "gbm_fit = gbm(Salary ~ ., data = train, distribution = \"gaussian\", n.trees = 1000, shrinkage = .05)\n",
    "gbm_preds = predict(gbm_fit, newdata = test, n.trees = 1000)\n",
    "gbm_mse = mean((gbm_preds - test$Salary)^2)\n",
    "paste0(\"The mse by boosting is: \", gbm_mse)\n",
    "paste0(\"The mse by linear model is: \", lin_mse)\n",
    "paste0(\"The mse by ridge regression is: \", rr_mse)\n"
   ]
