    "circle_df = rbind(circle_df, circle_df_neg)\n",
    "ggplot() +\n",
    "  geom_path(data = circle_df, aes(X1, X2), color = \"black\") +\n",
    "  labs(x = \"X1\", y = \"X2\") +\n",
    "  coord_fixed() + \n",
    "  theme_minimal()"
