    "points_df = data.frame(X1 = c(0, -1, 2, 3), X2 = c(0, 1, 2, 8), Class = c(\"Blue\", \"Red\", \"Blue\", \"Blue\"))\n",
    "\n",
    "ggplot() +\n",
    "  geom_path(data = circle_df, aes(X1, X2), color = \"black\") +\n",
    "  geom_point(data = points_df, aes(X1, X2, color = Class)) +\n",
    "  scale_color_manual(values = c(\"Blue\" = \"blue\", \"Red\" = \"red\")) +\n",
    "  labs(x = \"X1\", y = \"X2\") +\n",
    "  coord_fixed() + \n",
    "  theme_minimal()\n",
    "for (i in 1:nrow(points_df)) {\n",
    "  print(paste0(\"The point (\", points_df$X1[i], \", \", points_df$X2[i], \") is classified as \", points_df$Class[i]))\n",
    "}"
   ]
