    "set.seed(42)\n",
    "X1 = runif(500) - 0.5\n",
    "X2 = runif(500) - 0.5\n",
    "y = 1 * (X1^2 -X2^2 > 0)\n",
    "data = data.frame(X1 = X1, X2 = X2, y = as.factor(y))"
   ]
