   "source": [
    "costs = 10^seq(-2, 1, by = 0.25)\n",
    "cv.errors = rep(0, length(costs))\n",
    "for(i in seq_along(costs)) {\n",
    "    tune.out = tune(svm, y~., data = data, kernel = 'linear', ranges = list(cost=costs[i]), cross = 10)\n",
    "    best.model = tune.out$best.model\n",
    "    pred = predict(best.model, newdata = data)\n",
    "    svmfit = svm(y ~ ., data = data, kernel = 'linear', cost = costs[i], cross = 10)\n",
    "    cv.errors[i] = sum(pred != data$y)/nrow(data)\n",
    "}\n",
    "plot(costs, cv.errors, type = 'b', xlab = \"cost\", ylab = \"Cross-val error\" )\n"
   ]
