   "source": [
    "X1test = rnorm(20)\n",
    "X2test = rnorm(20)\n",
    "ytest = sample(rep(c(-1,1), each = 10))\n",
    "X1test[ytest == 1] = X1test[ytest == 1] + 1\n",
    "X2test[ytest == 1] = X2test[ytest == 1] + 1\n",
    "\n",
    "test.data = data.frame(X1 = X1test, X2 = X2test, y = as.factor(ytest))\n",
    "\n",
    "test.errors = rep(0, length(costs))\n",
    "\n",
    "for (i in 1:length(costs)) {\n",
    "    svm_new_fit = svm(y ~ ., data = data, kernel = 'linear', cost = costs[i])\n",
    "    ypred = predict(svm_new_fit, test.data)\n",
    "    test.errors[i] = sum(test.data$y != ypred)\n",
    "}\n",
    "\n",
    "# Plotting the test errors\n",
    "plot(costs, test.errors, type = 'b', xlab = \"cost\", ylab = \"Test error\")"
   ]
  },
